import logo from './logo.svg';
import './App.css';
import './css/styles.css'
import Banner from './Components/Banner';
import Header from './Components/Header';
import Heading from './Components/Heading';
import Index from '../src/Pages/Index';

function App() {
  return (
    <BrowserRouter> 
      <Header /> 
      <Switch>
        <Route path="/about"> 
          <About />
        </Route>
        <Route path="/contact">
          <Contact /> 
        </Route>
        <Route path="/"> 
          <Home />
        </Route> 
      </Switch>
      <Footer /> 
    </BrowserRouter>
  );
}

export default App;
